$templateCache.put("node_modules/gulp-devserver/node_modules/mockjs/demo/mock-kissy.html","<!DOCTYPE HTML>\n<html>\n<head>\n    <meta charset=\"utf-8\">\n    <title>Mock</title>\n    <link href=\"assets/bootstrap/css/bootstrap.css\" rel=\"stylesheet\">\n    <script type=\"text/javascript\" src=\"http://a.tbcdn.cn/s/kissy/1.3.0/seed.js\"></script>\n    <!-- <script src=\"../node_modules/kissy/build/seed-min.js\"></script> -->\n    <script src=\"../dist/mock.js\"></script>\n</head>\n<body>\n    <div class=\"container\">\n        <h1>Mock 测试 - KISSY</h1>\n        <h2>1. 设置模拟数据</h2>\n        <pre id=\"data\">\nMock.mock(\'foo.json\', {\n  \'list|3-5\':[{\n    \'id|+1\': 1,\n    \'name\': \'@First @Last\'\n  }]\n});\nMock.mock(\'bar.json\', {\n  \'list|3-5\':[{\n    \'id|+1\': 100,\n    \'email\': \'@EMAIL\'\n  }]\n});</pre>\n        <h2>2. 发送请求</h2>\n        <pre id=\"send\">\nKISSY.use([\'components/mock/index\', \'core\'], function(S, Mock, Core){\n    var $ = S.all;\n    KISSY.io({\n        url:\'foo.json\', \n        success: function(data){\n            $(\'#foo\').append(S.JSON.stringify(data, null, 4))\n        } \n    })\n    KISSY.io({\n        url:\'bar.json\',\n        success: function(data){\n            $(\'#bar\').append(S.JSON.stringify(data, null, 4))\n        }\n    })\n});</pre>\n        <h2>3. 响应数据</h2>\n        <pre id=\"foo\"></pre>\n        <pre id=\"bar\"></pre>\n    </div>\n    <script type=\"text/javascript\">\n        KISSY.use(\'core\', function(S, Core) {\n            var $ = S.all;\n            eval( $(\'#data\').text() )\n            eval( $(\'#send\').text() )\n        })\n    </script>\n</body>\n</html>\n");
